    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1608238071168,"commentText":"There are a few problems with plain old arrays:<br>- it is possible that a programmer can go outside the bounds of an array<br>- the size of the array has to be known at compile time and cannot change while the program is running<br>- the array doesn't know its own size<br><br>This program highlights those problems. <br><br>Later on I will discuss a similar construct to an array called a <font face=\"Courier\">vector</font>. <font face=\"Courier\">vectors</font> solve each of these problems. I have a whole chapter dedicated to <font face=\"Courier\">vectors</font>, you will see them soon.","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-178":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-178","timestamp":1505621267104,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":178,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-177","lineNumber":11,"column":20,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608237103174,"commentText":"Here I create an array of three <font face=\"Courier\">floats</font>.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"float arr[3];","startRow":6,"startColumn":4,"endRow":6,"endColumn":17}],"imageURLs":["media/images/1608237087290-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"7","currentFilePath":"/problems.cpp","viewableBlogText":"int main() \n{ \n    float arr[3]; \n \n    arr[0] = 10.0; \n    arr[1] = 20.0; \n    arr[2] = 30.0; \n \n    return 0; \n}","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-2","displayCommentEvent":{"id":"ev-178","timestamp":1505621267104,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":178,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-177","lineNumber":11,"column":20,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608237140763,"commentText":"Then I give each of the three <font face=\"Courier\">floats</font> a value.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"arr[0] = 10.0; \n    arr[1] = 20.0; \n    arr[2] = 30.0;","startRow":8,"startColumn":4,"endRow":10,"endColumn":18}],"imageURLs":["media/images/1608237130687-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/problems.cpp","viewableBlogText":"    float arr[3]; \n \n    arr[0] = 10.0; \n    arr[1] = 20.0; \n    arr[2] = 30.0; ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-242":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-242","timestamp":1505621287031,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":242,"type":"INSERT","fileId":"fileId-0","character":"y","previousNeighborId":"ev-241","lineNumber":12,"column":60,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608238291473,"commentText":"Every array has a fixed set of bounds. For this array the bounds are defined as the index values 0, 1, and 2. See the first attached picture.<br><div><br></div><div>The index I am using on line 12 is outside the bounds of the array. Unfortunately, in C++ this is perfectly acceptable.</div><div><br></div><div><div>The syntax used to access the elements of an array:<br></div><div><div><br></div><div><font face=\"Courier\">arrayName[index]</font></div></div><div><br></div><div>means that the computer will find the beginning of the array and move over the size of <font face=\"Courier\">index</font> elements from the beginning of the array. That piece of memory will then be available to use in the statement.<br></div><div><br></div><div>So,\n this moves outside the bounds of the array. Unfortunately, there are no\n error messages or warnings when you do this in your code (see the second attached picture).</div></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"arr[3] = 40.0;","startRow":11,"startColumn":4,"endRow":11,"endColumn":18}],"imageURLs":["media/images/1608237256369-03.png","media/images/1608237418750-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"5","linesBelow":"0","currentFilePath":"/problems.cpp","viewableBlogText":"    float arr[3]; \n \n    arr[0] = 10.0; \n    arr[1] = 20.0; \n    arr[2] = 30.0; \n    arr[3] = 40.0; //this is outside the bounds of the array ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-281":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-281","timestamp":1505621308953,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":281,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-280","lineNumber":13,"column":35,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609204189519,"commentText":"This goes way outside the bounds of the array. One problem with this is that there might be another variable living in this location that will get written over by this statement.<div><br></div><div>Perhaps there is a variable named <font face=\"Courier\">age</font> that holds the value 30.0. This statement will overwrite that value with 50.0.</div><div><br></div><div>This is a very hard bug to track down because it will be the person who is using <font face=\"Courier\">age</font> whose code will not work. The person will have no idea why an unexpected value, 50.0, is in the variable when it should hold the value 30.0.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"arr[100] = 50.0;","startRow":12,"startColumn":4,"endRow":12,"endColumn":20}],"imageURLs":["media/images/1608237574164-07.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"6","linesBelow":"0","currentFilePath":"/problems.cpp","viewableBlogText":"    float arr[3]; \n \n    arr[0] = 10.0; \n    arr[1] = 20.0; \n    arr[2] = 30.0; \n    arr[3] = 40.0; //this is outside the bounds of the array \n    arr[100] = 50.0; //so is this ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-450":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-450","timestamp":1505621382962,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":450,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-449","lineNumber":12,"column":64,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609204215039,"commentText":"Another problem with arrays is that their size must be known when the programmer compiles the program. If you attempt to prompt the user for a size, on most systems, you will get a syntax error.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"int sizeOfArray; \n \n    cout<<\"Enter in the size of the array: \"; \n    cin>>sizeOfArray; \n \n    float arr[sizeOfArray];","startRow":6,"startColumn":4,"endRow":11,"endColumn":27}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/problems.cpp","viewableBlogText":"    int sizeOfArray; \n \n    cout<<\"Enter in the size of the array: \"; \n    cin>>sizeOfArray; \n \n    float arr[sizeOfArray]; //size has to be set at compile time ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-7","displayCommentEvent":{"id":"ev-450","timestamp":1505621382962,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":450,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-449","lineNumber":12,"column":64,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609204232718,"commentText":"In addition, the size of the array cannot change while the program is running.<div><br></div><div>What programmers usually end up doing is declaring an array they think will be larger than needed and hope that the user will not over fill it. This is memory inefficient, however, and it does not guarantee that the user won't add more elements to the array than can be stored.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"sizeOfArray","startRow":11,"startColumn":14,"endRow":11,"endColumn":25}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/problems.cpp","viewableBlogText":"    float arr[sizeOfArray]; //size has to be set at compile time ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-550":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-550","timestamp":1505621443926,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":550,"type":"INSERT","fileId":"fileId-0","character":"\r","previousNeighborId":"ev-512","lineNumber":23,"column":6,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608749416832,"commentText":"The last major problem with arrays is that the programmer has to keep track of the size of each one they create.<div><br></div><div>This array has three elements. All loops that iterate through the elements need to know this size.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"float arr[3];","startRow":11,"startColumn":4,"endRow":11,"endColumn":17},{"fileId":"fileId-0","selectedText":"i < 3","startRow":19,"startColumn":18,"endRow":19,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/problems.cpp","viewableBlogText":"    float arr[3]; //size has to be set at compile time \n \n    arr[0] = 10.0; \n    arr[1] = 20.0; \n    arr[2] = 30.0; \n    //arr[3] = 40.0; //this is outside the bounds of the array \n    //arr[100] = 50.0; //so is this \n \n    for(int i = 0;i < 3;i++) \n    { \n        cout<<arr[i]<<endl; \n    }  ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-605":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-605","timestamp":1505621480446,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":605,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-604","lineNumber":18,"column":18,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608749441576,"commentText":"If the size of the array specified in the code changes, like it does here, then the programmer has to remember to update all of the loop tests.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"float arr[5];","startRow":11,"startColumn":4,"endRow":11,"endColumn":17},{"fileId":"fileId-0","selectedText":"i < 3","startRow":21,"startColumn":18,"endRow":21,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"6","currentFilePath":"/problems.cpp","viewableBlogText":"    float arr[5]; //size has to be set at compile time \n \n    arr[0] = 10.0; \n    arr[1] = 20.0; \n    arr[2] = 30.0; \n    arr[3] = 40.0; \n    arr[4] = 50.0; \n    //arr[3] = 40.0; //this is outside the bounds of the array \n    //arr[100] = 50.0; //so is this \n \n    for(int i = 0;i < 3;i++) \n    { \n        cout<<arr[i]<<endl; \n    } \n \n    return 0; \n}","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-10","displayCommentEvent":{"id":"ev-605","timestamp":1505621480446,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":605,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-604","lineNumber":18,"column":18,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609204307694,"commentText":"Unfortunately, I forgot to update the loop test on line 22 when I changed the size. This loop is not iterating through all of the elements.<div><br></div><div>When the array is used in many places in the code it can be easy to forget to update one or more loops. This is a very common error that even experienced programmers make occasionally.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"i < 3","startRow":21,"startColumn":18,"endRow":21,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"10","linesBelow":"3","currentFilePath":"/problems.cpp","viewableBlogText":"    float arr[5]; //size has to be set at compile time \n \n    arr[0] = 10.0; \n    arr[1] = 20.0; \n    arr[2] = 30.0; \n    arr[3] = 40.0; \n    arr[4] = 50.0; \n    //arr[3] = 40.0; //this is outside the bounds of the array \n    //arr[100] = 50.0; //so is this \n \n    for(int i = 0;i < 3;i++) \n    { \n        cout<<arr[i]<<endl; \n    } ","commentTags":[],"questionCommentData":null,"commentTitle":""}]};
